import math

def is_prime(num):
    if num < 1:
        return False
    for i in range(2, int(math.sqrt(num)) + 1):
        if num % i == 0:
            return False
    return True

def find_largest_prime(numbers):
    largest_prime = -1
    for num in numbers:
        if is_prime(num) and num > largest_prime:
            largest_prime = num
    return largest_prime

